import React from "react";
import "./Main.scss";
const CardSection = (img, h4, p) => {
  return (
    <div className="sec_4_box">
      <img src={{ img }} alt="loading" />
      <h4>{{ h4 }}</h4>
      <p>{{ p }}</p>
    </div>
  );
};

export default CardSection;
